import React from 'react';

const Dashboard = () => {
  return (
    <div className="h-screen w-screen flex items-center justify-center">
      <h1 className="text-4xl font-bold">Welcome to the Dashboard!</h1>
    </div>
  );
}

export default Dashboard;
